1\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BD%D0%B5_II_(%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%9B%D0%BE%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%B3%D0%B8%D0%B8)\" title=\"\u0420\u0435\u043d\u0435 II (\u0433\u0435\u0440\u0446\u043e\u0433 \u041b\u043e\u0442\u0430\u0440\u0438\u043d\u0433\u0438\u0438)\">\u0420\u0435\u043d\u0435 II \u041b\u043e\u0442\u0430\u0440\u0438\u043d\u0433\u0441\u043a\u0438\u0439<\/a> \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_%D0%A1%D0%BC%D0%B5%D0%BB%D1%8B%D0%B9\" title=\"\u041a\u0430\u0440\u043b \u0421\u043c\u0435\u043b\u044b\u0439\">\u041a\u0430\u0440\u043b\u0430 \u0421\u043c\u0435\u043b\u043e\u0433\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9D%D0%B0%D0%BD%D1%81%D0%B8\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041d\u0430\u043d\u0441\u0438\">\u0443 \u0441\u0442\u0435\u043d \u041d\u0430\u043d\u0441\u0438<\/a>. \u0420\u0430\u0437\u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D1%86%D0%BE%D0%B3%D1%81%D1%82%D0%B2%D0%BE_%D0%91%D1%83%D1%80%D0%B3%D1%83%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u043e \u0411\u0443\u0440\u0433\u0443\u043d\u0434\u0438\u044f\">\u0411\u0443\u0440\u0433\u0443\u043d\u0434\u0438\u0438<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e\u043c \u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B1%D1%81%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%BE%D0%BD%D0%B0%D1%80%D1%85%D0%B8%D1%8F\" title=\"\u0413\u0430\u0431\u0441\u0431\u0443\u0440\u0433\u0441\u043a\u0430\u044f \u043c\u043e\u043d\u0430\u0440\u0445\u0438\u044f\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c \u0413\u0430\u0431\u0441\u0431\u0443\u0440\u0433\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1675_%D0%B3%D0%BE%D0%B4\" title=\"1675 \u0433\u043e\u0434\">1675<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%A2%D1%83%D1%80%D0%BA%D1%85%D0%B0%D0%B9%D0%BC%D0%B5\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0422\u0443\u0440\u043a\u0445\u0430\u0439\u043c\u0435\">\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0422\u0443\u0440\u043a\u0445\u0430\u0439\u043c\u0435<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%8E%D1%80%D0%B5%D0%BD%D0%BD,_%D0%90%D0%BD%D1%80%D0%B8_%D0%B4%D0%B5_%D0%9B%D0%B0_%D0%A2%D1%83%D1%80_%D0%B4%E2%80%99%D0%9E%D0%B2%D0%B5%D1%80%D0%BD%D1%8C\" title=\"\u0422\u044e\u0440\u0435\u043d\u043d, \u0410\u043d\u0440\u0438 \u0434\u0435 \u041b\u0430 \u0422\u0443\u0440 \u0434\u2019\u041e\u0432\u0435\u0440\u043d\u044c\">\u043c\u0430\u0440\u0448\u0430\u043b\u0430 \u0422\u044e\u0440\u0435\u043d\u043d\u0430<\/a> \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b\u0430 \u0431\u0440\u0430\u043d\u0434\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0443\u044e \u0430\u0440\u043c\u0438\u044e.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1728_%D0%B3%D0%BE%D0%B4\" title=\"1728 \u0433\u043e\u0434\">1728<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0413\u0430\u0432\u0430\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0413\u0430\u0432\u0430\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1757_%D0%B3%D0%BE%D0%B4\" title=\"1757 \u0433\u043e\u0434\">1757<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BC%D1%8C%D0%B5%D0%BD,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80-%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0\" title=\"\u0414\u0430\u043c\u044c\u0435\u043d, \u0420\u043e\u0431\u0435\u0440-\u0424\u0440\u0430\u043d\u0441\u0443\u0430\">\u0420\u043e\u0431\u0435\u0440-\u0424\u0440\u0430\u043d\u0441\u0443\u0430 \u0414\u0430\u043c\u044c\u0435\u043d<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043d\u0435\u0443\u0434\u0430\u0447\u043d\u043e\u0435 \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XV\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XV\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a\u0430 XV<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1762_%D0%B3%D0%BE%D0%B4\" title=\"1762 \u0433\u043e\u0434\">1762<\/a>&#160;\u2014 \u041d\u0430 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u0440\u0435\u0441\u0442\u043e\u043b \u0432\u0441\u0442\u0443\u043f\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_III\" title=\"\u041f\u0451\u0442\u0440 III\">\u041f\u0451\u0442\u0440 III<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1769_%D0%B3%D0%BE%D0%B4\" title=\"1769 \u0433\u043e\u0434\">1769<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B0%D1%82%D1%82,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81\" title=\"\u0423\u0430\u0442\u0442, \u0414\u0436\u0435\u0439\u043c\u0441\">\u0414\u0436\u0435\u0439\u043c\u0441 \u0423\u0430\u0442\u0442<\/a> \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 \u043f\u0430\u0442\u0435\u043d\u0442 \u043d\u0430 \u0441\u0432\u043e\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B0%D1%88%D0%B8%D0%BD%D0%B0\" title=\"\u041f\u0430\u0440\u043e\u0432\u0430\u044f \u043c\u0430\u0448\u0438\u043d\u0430\">\u043f\u0430\u0440\u043e\u0432\u0443\u044e \u043c\u0430\u0448\u0438\u043d\u0443<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1809_%D0%B3%D0%BE%D0%B4\" title=\"1809 \u0433\u043e\u0434\">1809<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/en.wikipedia.org\/wiki\/Treaty_of_the_Dardanelles\" class=\"extiw\" title=\"en:Treaty of the Dardanelles\">\u0414\u0430\u0440\u0434\u0430\u043d\u0435\u043b\u043b\u044c\u0441\u043a\u0438\u0439 \u043c\u0438\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%94%D0%B0%D1%80%D0%B4%D0%B0%D0%BD%D0%B5%D0%BB%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0414\u0430\u0440\u0434\u0430\u043d\u0435\u043b\u043b\u044c\u0441\u043a\u0438\u0439 \u043c\u0438\u0440 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0440\u0443\u0441\u0441\u043a.<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D1%82%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1807%E2%80%941809)\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1807\u20141809)\">\u0410\u043d\u0433\u043b\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_%D0%9F%D0%BE%D1%80%D1%82-%D0%90%D1%80%D1%82%D1%83%D1%80%D0%B0\" title=\"\u041e\u0431\u043e\u0440\u043e\u043d\u0430 \u041f\u043e\u0440\u0442-\u0410\u0440\u0442\u0443\u0440\u0430\">\u043a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u044f \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u0438 \u041f\u043e\u0440\u0442-\u0410\u0440\u0442\u0443\u0440<\/a> \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%8F%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u044f\u043f\u043e\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0440\u0443\u0441\u0441\u043a\u043e-\u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%82%D0%B0%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041c\u0438\u0442\u0430\u0432\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u041c\u0438\u0442\u0430\u0432\u0441\u043a\u043e\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82_(%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0)\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u0444\u0440\u043e\u043d\u0442 (\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430)\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u043c \u0444\u0440\u043e\u043d\u0442\u0435<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u044f\u044f \u0432\u043e\u0435\u043d\u043d\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0420\u0443\u0441\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u0420\u0443\u0441\u0441\u043a\u043e\u0439 \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438<\/a>, \u043e\u043d\u0430 \u0431\u044b\u043b\u0430 \u043f\u0440\u0438\u0437\u0432\u0430\u043d\u0430 \u043b\u0438\u043a\u0432\u0438\u0434\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u043f\u043b\u0430\u0446\u0434\u0430\u0440\u043c, \u043d\u0430\u0446\u0435\u043b\u0435\u043d\u043d\u044b\u0439 \u043d\u0430 \u0420\u0438\u0433\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D0%BE%D1%87%D0%B5-%D0%9A%D1%80%D0%B5%D1%81%D1%82%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%90%D1%80%D0%BC%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0420\u0430\u0431\u043e\u0447\u0435-\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0410\u0440\u043c\u0438\u044f\">\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0430\u0440\u043c\u0438\u044f<\/a> \u0437\u0430\u043d\u044f\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%BD%D1%8E%D1%81\" title=\"\u0412\u0438\u043b\u044c\u043d\u044e\u0441\">\u0412\u0438\u043b\u044c\u043d\u044e\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8E%D0%BD%D1%85%D0%B5%D0%BD\" title=\"\u041c\u044e\u043d\u0445\u0435\u043d\">\u041c\u044e\u043d\u0445\u0435\u043d\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u041d\u0435\u043c\u0435\u0446\u043a\u0430\u044f \u0440\u0430\u0431\u043e\u0447\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f, \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u0433\u043e\u0434 \u0441\u043f\u0443\u0441\u0442\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB-%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BD%D0%B5%D0%BC%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D0%B1%D0%BE%D1%87%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b-\u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u0430\u044f \u0440\u0430\u0431\u043e\u0447\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f\">\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b-\u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u043d\u0435\u043c\u0435\u0446\u043a\u0443\u044e \u0440\u0430\u0431\u043e\u0447\u0443\u044e \u043f\u0430\u0440\u0442\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D1%81%D0%BF%D0%B0%D1%80%D1%82%D0%B0%D0%BA%D0%B8%D1%81%D1%82%D0%BE%D0%B2\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0441\u043f\u0430\u0440\u0442\u0430\u043a\u0438\u0441\u0442\u043e\u0432\">\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0421\u043f\u0430\u0440\u0442\u0430\u043a\u0438\u0441\u0442\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D1%80%D0%B0%D1%81%D0%BE%D0%B2%D0%BE%D0%B5_%D0%91%D1%8E%D1%80%D0%BE_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0440\u0430\u0441\u043e\u0432\u043e\u0435 \u0411\u044e\u0440\u043e \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0440\u0430\u0441\u043e\u0432\u043e\u0435 \u0411\u044e\u0440\u043e \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u043f\u0440\u0438\u0437\u043d\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B0%D0%B8%D0%BC%D1%8B\" title=\"\u041a\u0430\u0440\u0430\u0438\u043c\u044b\">\u043a\u0430\u0440\u0430\u0438\u043c\u043e\u0432<\/a> \u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u044f\u043c\u0438<\/a> \u043d\u0438 \u043f\u043e \u0432\u0435\u0440\u043e\u0438\u0441\u043f\u043e\u0432\u0435\u0434\u0430\u043d\u0438\u044e, \u043d\u0438 \u043f\u043e \u0440\u0430\u0441\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D0%BE%D0%BD%D0%B8%D0%BA%D0%B0_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B9_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\/%D0%AF%D0%BD%D0%B2%D0%B0%D1%80%D1%8C_1942_%D0%B3%D0%BE%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u0425\u0440\u043e\u043d\u0438\u043a\u0430 \u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b\/\u042f\u043d\u0432\u0430\u0440\u044c 1942 \u0433\u043e\u0434\u0430\">\u041d\u0430\u0447\u0430\u043b\u043e \u0437\u0438\u043c\u043d\u0435\u0433\u043e \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f \u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u0410\u0440\u043c\u0438\u0438<\/a>. \u0412\u044b\u0441\u0430\u0434\u043a\u0430 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0434\u0435\u0441\u0430\u043d\u0442\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D0%BF%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D1%8F\" title=\"\u0415\u0432\u043f\u0430\u0442\u043e\u0440\u0438\u044f\">\u0415\u0432\u043f\u0430\u0442\u043e\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a>&#160;\u2014 \u041a \u0431\u0435\u0440\u0435\u0433\u0430\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%B4%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u0430\">\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u044b<\/a> \u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%8D%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f\">\u041a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u043d\u0430\u044f \u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 \u0412 \u043f\u0435\u0440\u0432\u043e\u043c \u043d\u043e\u043c\u0435\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%85%D0%BD%D0%B8%D0%BA%D0%B0_%E2%80%94_%D0%BC%D0%BE%D0%BB%D0%BE%D0%B4%D1%91%D0%B6%D0%B8\" title=\"\u0422\u0435\u0445\u043d\u0438\u043a\u0430 \u2014 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438\">\u0436\u0443\u0440\u043d\u0430\u043b\u0430 \u00ab\u0422\u0435\u0445\u043d\u0438\u043a\u0430&#160;\u2014 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438\u00bb<\/a> \u0437\u0430 1957 \u0433\u043e\u0434 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043f\u0443\u0431\u043b\u0438\u043a\u0430\u0446\u0438\u044f \u0440\u043e\u043c\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D1%84%D1%80%D0%B5%D0%BC%D0%BE%D0%B2,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0415\u0444\u0440\u0435\u043c\u043e\u0432, \u0418\u0432\u0430\u043d \u0410\u043d\u0442\u043e\u043d\u043e\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d\u0430 \u0415\u0444\u0440\u0435\u043c\u043e\u0432\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BC%D0%B0%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%90%D0%BD%D0%B4%D1%80%D0%BE%D0%BC%D0%B5%D0%B4%D1%8B_(%D1%80%D0%BE%D0%BC%D0%B0%D0%BD)\" title=\"\u0422\u0443\u043c\u0430\u043d\u043d\u043e\u0441\u0442\u044c \u0410\u043d\u0434\u0440\u043e\u043c\u0435\u0434\u044b (\u0440\u043e\u043c\u0430\u043d)\">\u00ab\u0422\u0443\u043c\u0430\u043d\u043d\u043e\u0441\u0442\u044c \u0410\u043d\u0434\u0440\u043e\u043c\u0435\u0434\u044b\u00bb<\/a>&#160;\u2014 \u044d\u0442\u0430\u043f\u043d\u043e\u0433\u043e \u0432 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0438 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0444\u0430\u043d\u0442\u0430\u0441\u0442\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u043f\u0440\u0438\u0445\u043e\u0434 \u043a \u0432\u043b\u0430\u0441\u0442\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0